import React from 'react';
import {
  BackgroundWrapper,
  MyPostWrapper,
  ProfileImg,
  ProfileWrapper,
} from './MypageStyle';
import Profile from '../../assets/img/profile.jpg';

const Mypage: React.FC = () => {
  return (
    <BackgroundWrapper>
      <ProfileWrapper>
        <ProfileImg src={Profile} />
      </ProfileWrapper>
      <MyPostWrapper />
    </BackgroundWrapper>
  );
};

export default Mypage;
